      return (
        <SliderContext.Consumer>
          {(context) => (
            <WrappedComponent
              ref={r => (this.contentRef = r)}
              sliderContext={context}
              {...this.props}
            />
          )}
        </SliderContext.Consumer>
      );
    }
  }

  hoistNonReactStatic(SliderContextConsumer, WrappedComponent);

  return SliderContextConsumer;
}

